import React,{useEffect} from 'react';
import Chip from '@material-ui/core/Chip';
import Avatar from '@material-ui/core/Avatar';

//import {crt1,crt2,crt3,crt4} from './tabla_calificaciones'

export const ChipCriterios = (data) => {

    const { ccx1, ccx2, ccx3, ccx4, crt1, c2,c3, c4 } = data

    return (
        <div>
            <Chip size="small" avatar={<Avatar>{ccx1}</Avatar>} label={crt1} color="secondary" />
            <Chip size="small" avatar={<Avatar>{ccx2}</Avatar>} label={c2} color="secondary" />
            <Chip size="small" avatar={<Avatar>{ccx3}</Avatar>} label={c3} color="secondary" />
            <Chip size="small" avatar={<Avatar>{ccx4}</Avatar>} label={c4} color="secondary" />
        </div>
    );
}
